#
# TABLE STRUCTURE FOR: tourreview
#

DROP TABLE IF EXISTS `tourreview`;

CREATE TABLE `tourreview` (
  `TourReviewID` int(11) NOT NULL AUTO_INCREMENT,
  `TourID` int(11) NOT NULL,
  `ReviewByUser` int(11) NOT NULL,
  `BookingID` int(11) NOT NULL,
  `Comment` text NOT NULL,
  `Rating` varchar(10) NOT NULL,
  PRIMARY KEY (`TourReviewID`),
  KEY `usertour_ibfk_1` (`TourID`),
  KEY `usertour_ibfk_2` (`ReviewByUser`),
  KEY `usertour_ibfk_3` (`BookingID`),
  CONSTRAINT `tourreview_ibfk_1` FOREIGN KEY (`ReviewByUser`) REFERENCES `user` (`UserID`) ON DELETE CASCADE,
  CONSTRAINT `usertour_ibfk_1` FOREIGN KEY (`TourID`) REFERENCES `tour` (`TourID`),
  CONSTRAINT `usertour_ibfk_3` FOREIGN KEY (`BookingID`) REFERENCES `booking` (`BookingID`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=latin1;



